import React from "react";
// reactstrap components
import {
    Badge,
    Card,
    CardHeader,
    CardFooter,
    DropdownMenu,
    DropdownItem,
    UncontrolledDropdown,
    DropdownToggle,
    Media,
    Pagination,
    PaginationItem,
    PaginationLink,
    Progress,
    Table,
    Container,
    Row,
    UncontrolledTooltip
  } from "reactstrap";
  // core components
  import Header from "components/Headers/Header.js";
  import APIAirport from "./../../apis/APIAirport.js";
const serviceAirport = new APIAirport();

class Airport extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            infoAirports: [],
            infoAirport: [],
            foundAirport: false,

        };

    }

    componentWillMount= async()=>{
        const resultAirports = await serviceAirport.queryAllAirports();
        if (resultAirports["estado"].length<3)
            this.setState({infoAirports: resultAirports["resultado"]});
       

         

    }

    render() {
        return (
            <>
            <Header/>
            <Container className="mt--7" fluid>
                {/* Table */}
                <Row>
                    <div className="col">
                    <Card className="shadow">
                        <CardHeader className="border-0">
                        <h3 className="mb-0">Registro de aeropuertos</h3>
                        </CardHeader>
                        <Table className="align-items-center table-flush" responsive>
                        <thead className="thead-light">
                            <tr>
                            <th scope="col">Código de aeropuerto</th>
                            <th scope="col">Descripción</th>
                            <th scope="col">País</th>
                            <th scope="col">Ciudad</th>
                            <th scope="col">Longitud</th>
                            <th scope="col">Latitud</th>
                            <th scope="col" />
                            </tr>
                        </thead>
                        <tbody>
                            {!this.state.infoAirports?
                             this.state.infoAirports.map((airport)=>{
                               return(
                                    <tr>
                                        <th>{airport["code"]}</th>
                                        <td>{airport["description"]}</td>
                                        <td>{airport["city"]["country"]["name"]}</td>
                                        <td>{airport["city"]["name"]}</td>
                                        <td>{airport["longitude"]}</td>
                                        <td>{airport["latitude"]}</td>
                                    </tr>
                               );
                             })
                            :
                            ""}
                            
                        </tbody>
                        </Table>
                    </Card>
                    </div>
                </Row>
            </Container>
            </>
        )
    }
}  
export default Airport;
